import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 32, height: 32, viewBox: "0 0 32 32", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M28.7 3.3a1 1 0 010 1.4l-24 24a1 1 0 01-1.4-1.4l24-24a1 1 0 011.4 0z", fill: primaryFill }));
};
const Line32Regular = wrapIcon(rawSvg({}), 'Line32Regular');
export default Line32Regular;
